// ==UserScript==
// @name           GCFriends
// @include        http://www.geocaching.com/*
// @include        http://geocaching.com/*
// @grant          GM_getValue
// @grant          GM_setValue
// @grant          GM_log
// @grant          GM_addStyle
// @description  Stay informed about activities of your friends  (on geocaching.com).
// ==/UserScript==
var browserType = "unknown";
var database;
var $;
var jqueryLoadInterval;
var announceTimeOutId = 0;
var opendPopups = {};
var loadedMenueItems = {};
var numMenueItemsToLoad = 15;
var processBar = null;
var logging = null;
var friendLength;
var logData = {};

var images = {
    "icon": 'data:image/png;base64,',
    "iconGreen": 'data:image/png;base64,',
    "iconBlue": 'data:image/png;base64,',
    "iconOrange": 'data:image/png;base64,',
    "iconRed": 'data:image/png;base64,',
    "iconIgnore": 'data:image/png;base64,',
    "iconUpDown": 'data:image/png;base64,',
    "iconNew": 'data:image/png;base64,'
};

if (typeof (opera) != "undefined") {
    browserType = "Opera";
} else if (typeof (chrome) != "undefined") {
    browserType = "Chrome";

    var div = document.createElement("div");
    div.setAttribute("onclick", "return window;");
    unsafeWindow = div.onclick();

    if ((GM_getValue.toString && GM_getValue.toString().indexOf("not supported") != -1) || typeof (GM_getValue) == "undefined") {
        GM_getValue = function (key, defaultValue) {
            var result = localStorage.getItem(key);
            if (!result || result == "undefined") {
                return defaultValue;
            } else {
                var type = result[0];
                switch (type) {
                    case 'b':
                        result = result.substring(1);
                        return result == 'true';
                    case 'n':
                        result = result.substring(1);
                        return Number(result);
                    case 's':
                        result = result.substring(1);
                        return String(result);
                    default:
                        return result;
                }
            }
        }
    }

    if (typeof (GM_setValue) == "undefined" || (GM_setValue.toString && GM_setValue.toString().indexOf("not supported") != -1)) {
        GM_setValue = function (key, value) {
            var type = (typeof value)[0];
            var data = ((type == 'b' || type == 'n' || type == 's') ? type : "") + value;
            localStorage.setItem(key, data);
        }
    }


} else if (typeof (safari) != "undefined") {
    browserType = "Safari";
} else {
    browserType = "FireFox";
}
loadDatabase();

function main() {
    $ = unsafeWindow.$;
    loadGritter();
    loadSlimScroll();

    if (GM_getValue("gcFriendsFirstRun", true)) {
        firstRun();
    } else {
        var lastUpdate = parseInt(GM_getValue("GCFriends_lastUpdate", 1));
        if (Date.now() - lastUpdate > 3600000) {
            setTimeout(function () {
                requestFriendList();
            }, 500);
        }

        if (document.URL.search("www.geocaching.com\/map") >= 0) {
            //MAP
            enableMapPopups();
            //insertButton();
        } else {
            insertButton();
        }

        if (document.URL.search("www.geocaching.com\/my\/myfriends") >= 0) {
            addGroupMenue();
            insertFriendPageLinks();
        } else if (document.URL.search("www.geocaching.com\/seek\/cache_details") >= 0) {
            addGroupItemToCachePage();
        }

        setInterval(function () {
            if (GM_getValue("GCFriends_overviewContainsUnreadElements", false)) {
                updateButtonNotificator(true);
            }

            var announceTill = parseInt(GM_getValue("GCFriends_announceTill", 0));
            
            if (Date.now() - announceTill < 0) {
                clearTimeout(announceTimeOutId);
                announceTimeOutId = setTimeout(function () {     
                    announceNewItems();
                    updateMenue();
                }, 4000);
            }

        }, 5000);
    }
}

function firstRun() {
    if (document.URL.search("www.geocaching.com\/my\/myfriends") >= 0) {
        addGroupMenue();
        $('<a style="magin-left:5px;" href="#">Start initial crawling...</a>').insertAfter('#GCFriendsGroupContainer').button().click(function () {
            if (browserType == "FireFox") {
                setTimeout(function () {
                    startCrawling();
                }, 0);
            } else {
                startCrawling();
            }
            return false;
        });
        $("#gcFriendsTabs").tabs('select', 4);
        $('#GCFriendsGroupContainer').slideDown();
        alert("GCFriends - First Start\nPlease fill the ignore list and click the button to start the initial crawling.");
        $("#gcFriendsTabs").tabs('select', 4);
    } else if (document.URL.search("www.geocaching.com\/login\/default") == -1) {
        alert("GCFriends - First Start\nYou will be redirected to your friend page.");
        window.location.href = "http://www.geocaching.com/my/myfriends.aspx";
    } else {
        alert("GCFriends - First Start\nPlease login first...");
    }
}

function startCrawling() {
    GM_setValue("gcFriendsFirstRun", false);
    $('<div id="gcFriendsFirstRunOverlay" style="text-align:center; position: fixed;top:0; bottom:0; left:0; width:100%;height:100%;background:#FFFFFF;z-index:999999"> <h1>GCFriends - First run</h1> <p>Crawling found caches of your friends - please do not interrupt and do NOT use the geocaching.com site in other tabs.</p> <br> <br> <div style="height:20px; width:100%;" id="progressbar"></div> <ul id="logging" style="height:450px;overflow:scroll;"></ul></div>').appendTo("body");
    processBar = $("#progressbar").progressbar({
        "value": false
    })[0];

    logging = $("#logging")[0];
    requestFriendList();
}

function loadDatabase() {
    database = JSON.parse(GM_getValue("GCFriends_database", '{"elements":{}, "newElements":[], "cacheLogs":{}, "otherElements":[], "groups":{"Green":[],"Blue":[],"Orange":[],"Red":[], "Ignore":[]}}'));
}

function saveDatabase() {
    GM_setValue("GCFriends_database", JSON.stringify(database));
}

function requestFriendList() {
    $.get('http://www.geocaching.com/my/myfriends.aspx', function (data) {
        if (browserType == "FireFox") {
            setTimeout(function () {
        updateFriends(parseFriendData(data));
            }, 0);
        } else {
            updateFriends(parseFriendData(data));
        }  
    });
}

function parseFriendData(data) {
    return $(data).find('.FriendText').map(function () {
        var namesAndLinks = $(this).find('a[id$="_lnkName"]').map(function () {
            return [$(this).text(), this.href];
        });
        var foundHiddenData = $(this).find('dt:contains("Found"),dt:contains("Hidden:")').next().map(function () {
            return parseInt($(this).text().trim().replace(",", "").replace(".", ""), 10);
        });

        return {
            "name": namesAndLinks[0],
            "profileLink": namesAndLinks[1],
            "avatarLink": $(this).parent().find(".FriendAvatar img")[0].src,
            "numFound": foundHiddenData[0],
            "numHidden": foundHiddenData[1],
            "linkFound": "http://www.geocaching.com/seek/nearest.aspx?ul=" + namesAndLinks[0],
            "linkHidden": "http://www.geocaching.com/seek/nearest.aspx?u=" + namesAndLinks[0]
        };
    }).toArray();
}

function updateFriends(friendData) {
    GM_log("Updating friendlist...");

    friendLength = friendData.length;
    for (i = 0; i < friendData.length; i++) {
        loadDatabase();
        if (database.groups.Ignore[friendData[i].name]) {
            continue;
        }
        if (!database[friendData[i].name]) {
            database[friendData[i].name] = {
                "name": friendData[i].name,
                "profileLink": friendData[i].profileLink,
                "avatarLink": friendData[i].avatarLink,
                "numFound": friendData[i].numFound,
                //"numHidden":friendData[i].numHidden,
                "foundModifier": 0,
                "found": [],
                "hidden": [],
                "linkFound": friendData[i].linkFound,
                "linkHidden": friendData[i].linkHidden
            };

            startLoadingPages(friendData[i].name);
        } else {
            if (friendData[i].numFound > (database[friendData[i].name].found.length + database[friendData[i].name].foundModifier)) {
                //New Founds
                startLoadingPages(friendData[i].name);
            }

            if (friendData[i].numHidden > database[friendData[i].name].hidden.length) {
                //New Hides
            }

            database[friendData[i].name].avatarLink = friendData[i].avatarLink;
        }

        if (database.newElements.length > 0) {
            announceNewItems();
        }

        saveDatabase();
    }
    
    GM_setValue("GCFriends_lastUpdate", (Date.now()).toString());
}

function updateLog(user, current, all) {
    GM_log(user + " siteNumber: " + current + "/" + all);
    if (processBar != null && logging != null) {
        if (!logData[user]) {
            logData[user] = {
                "current": current,
                "all": all
            };
        } else {
            logData[user].current = current;
        }

        var total = 0;
        var count = 0;
        var end = true;
        var number = 0;

        for (userName in logData) {
            if (!database.groups.Ignore[userName]) {
                total += logData[userName].all;
                count += logData[userName].current;
                if (logData[userName].all != logData[userName].current) {
                    end = false;
                }

                number++;
            }
        }

        for (ignoredNames in database.groups.Ignore) {
            number++;
        }

        $(processBar).progressbar("option", {
            value: Math.floor((count / total) * 100)
        });

        $(logging).append('<li style="list-style-type: none;" >' + user + " siteNumber: " + current + "/" + all + '</li>');
        logging.scrollTop = logging.scrollHeight;


        if (end && friendLength <= number) {           
            $('#gcFriendsFirstRunOverlay').fadeOut().remove();            
            alert("GCFriends\nAll caches of your friends have been crawled.\nYou can use GCFriends now.");            
            window.location.href = window.location.pathname;
        }
    }
}

function getFirstListPage(url) {
    $.get(url, function (siteData) {
        if (browserType == "FireFox") {
            setTimeout(function () {
        handleListPageData(siteData);
            }, 0);
        } else {
            handleListPageData(siteData);
        }        
    });
}

function getListPage(url, pageNumber, currentPage) {
    var hiddenForm = $(currentPage).filter("form");
    var viewStateCount = $(hiddenForm).find("#__VIEWSTATEFIELDCOUNT")[0].value;
    var postDataString = /*"__EVENTTARGET=ctl00%24ContentBody%24pgrTop%24lbGoToPage_"+pageNumber+"*/ "__EVENTTARGET=ctl00%24ContentBody%24pgrTop%24ctl08&__EVENTARGUMENT=&__LASTFOCUS=&__VIEWSTATEFIELDCOUNT=" + encodeURIComponent(viewStateCount);
    postDataString += (($(hiddenForm).find("#__VIEWSTATE").length == 1) ? ("&__VIEWSTATE=" + encodeURIComponent($(hiddenForm).find("#__VIEWSTATE")[0].value)) : "");

    for (i = 1; i < viewStateCount; i++) {
        postDataString += (($(hiddenForm).find("#__VIEWSTATE" + i).length == 1) ? ("&__VIEWSTATE" + i + "=" + encodeURIComponent($(hiddenForm).find("#__VIEWSTATE" + i)[0].value)) : "");
    }

    postDataString += "&navi_search=";

    var request = new window.XMLHttpRequest();
    request.onreadystatechange = function () {
        if (request.readyState == 4 && request.status == 200) {
            if (browserType == "FireFox") {
                setTimeout(function () {
                    handleListPageData(request.responseText);
                }, 0);
            } else {
                handleListPageData(request.responseText);
            }
        } else if (request.readyState == 4) {
            alert("Error while getting Found-Pages: " + request.status + " " + request.statusText);
        }
    };
    request.open("POST", url, true);
    request.setRequestHeader("Content-Type", "application/x-www-form-urlencoded");
    request.send(postDataString);
}

function handleListPageData(siteData) {
    var matches = /(Page: <b>)([0-9]+)(<\/b> of <b>)([0-9]+)(?=<\/b>)/.exec(siteData);
    var matches2 = /(action="nearest\.aspx\?ul=)([^\"]+)(?=" id)/.exec(siteData);
    var siteNumber = parseInt(matches[2]);
    var totalSiteNumber = parseInt(matches[4]);
    var userName = matches2[2];

    GM_log(userName + " siteNumber: " + siteNumber + "/" + totalSiteNumber);

    loadDatabase();
    var newElements = parseListPage(siteData);
    //var oldFoundCount = database[newElements[0].FoundByUser].found.length;

    for (i = 0; i < newElements.length; i++) {
        if (database.elements[newElements[i].Id]) {
            continue;
        }

        if (!database.cacheLogs[newElements[i].WPId]) {
            database.cacheLogs[newElements[i].WPId] = [];
        }
        database.cacheLogs[newElements[i].WPId].push(newElements[i].Id);
        //		$.unique(database.cacheLogs[newElements[i].WPId]);
        database.newElements.push(newElements[i].Id);
        database[newElements[i].FoundByUser].found.push(newElements[i].Id);
        //		$.unique(database[newElements[i].FoundByUser].found);
        database.elements[newElements[i].Id] = newElements[i];
    }

    //$.unique(database.newElements);
    saveDatabase();

    updateLog(userName, siteNumber, totalSiteNumber);

    if (siteNumber < totalSiteNumber && database[newElements[0].FoundByUser].numFound > (database[newElements[0].FoundByUser].found.length + database[newElements[0].FoundByUser].foundModifier)) { //oldFoundCount < database[newElements[0].FoundByUser].found.length){
        if (!database.groups.Ignore[userName]) {
            getListPage("http://www.geocaching.com/seek/nearest.aspx?ul=" + userName, siteNumber + 1, siteData);
        }
    } else {
        handleAllSitePagesLoaded(userName);
    }
}

function startLoadingPages(userName) {
    GM_log("Start loading sites for: " + userName);
    if (!database.groups.Ignore[userName]) {
        getFirstListPage("http://www.geocaching.com/seek/nearest.aspx?ul=" + userName);
    }
}

function handleAllSitePagesLoaded(userName) {
    GM_log("All sites loaded for: " + userName);

    sortNewItems();

    if (database[userName].numFound > (database[userName].found.length + database[userName].foundModifier)) {
        if (confirm("All pages for " + userName + "were crawled, but we are missing " + (database[userName].numFound - database[userName].found.length) + "cache(s).\n Should we ignore this 'gap' the next time?")) {
            loadDatabase();
            database[userName].foundModifier = (database[userName].numFound - database[userName].found.length);
            saveDatabase();
        }
    }

    clearTimeout(announceTimeOutId);
    announceTimeOutId = setTimeout(function () {
        GM_setValue("GCFriends_announceTill", (Date.now() + 5000).toString());
        GM_setValue("GCFriends_lastUpdate", (Date.now()).toString());
        announceNewItems();
        updateMenue();
    }, 4000);
}

function parseListPage(siteData) {
    var cacheFoundByUser = $(siteData).find("#ctl00_ContentBody_LocationPanel1_OriginLabel").text().split(':')[1].trim();
    return $(siteData).find('.SearchResultsTable').find("tr").map(function () {
        if ($(this).find("th").length > 0) {
            return null;
        }

        var cacheTypeCode = $(this).find('img[src^="http://www.geocaching.com/images/wpttypes"]')[0].src.match("[0-9a-zA-Z]+(?=.gif)")[0];
        var cacheType;
        switch (cacheTypeCode) {
            case "2":
                cacheType = "Traditional";
                break;
            case "3":
                cacheType = "Multi";
                break;
            case "4":
                cacheType = "Virtual";
                break;
            case "5":
                cacheType = "LetterBox";
                break;
            case "6":
                cacheType = "Event";
                break;
            case "8":
                cacheType = "Unknown";
                break;
            case "11":
                cacheType = "Webcam";
                break;
            case "12":
                cacheType = "Locationless";
                break;
            case "13":
                cacheType = "CITO";
                break;
            case "1858":
                cacheType = "Whereigo";
                break;
            case "earthcache":
                cacheType = "Earthcache";
                break;
            default:
                cacheType = "NotFound";
                break;
        }

        var cacheName = "NotFound";
        var cacheWPId = "NotFound";
        var cacheOwner = "NotFound";

        var temp = $(this).find('.Merge span');
        cacheName = $(temp[0]).text().trim();
        temp = $(temp[1]).text().split("|");
        cacheOwner = temp[0].replace("by ", "").trim();
        cacheWPId = temp[1].trim();

        var cacheFoundByUserDate = $(this).find('td .small').last().text().split("\n")[1].replace('*', '').trim();

        return {
            "Name": cacheName,
            "WPId": cacheWPId,
            "Type": cacheType,
            "Owner": cacheOwner,
            "FoundByUser": cacheFoundByUser,
            "FoundByUserDate": parseDate(cacheFoundByUserDate),
            "TypeCode": cacheTypeCode,
            "Id": cacheWPId + cacheFoundByUser + parseDate(cacheFoundByUserDate).toJSON()
        };
    });
}

function parseDate(dateString) {
    if (dateString.indexOf("ago") == -1) {
        var dateItems = dateString.split('/');
        return new Date(dateItems[2], dateItems[0] - 1, dateItems[1], 0, 0, 0, 0);
    } else {
        var resultDate = new Date((new Date()).toDateString());

        var number = dateString.match(/[0-9]+/);
        if (dateString.indexOf("day") != -1) {
            var newDate = new Date(resultDate - (parseInt(number[0]) * 86400000));
            resultDate = newDate;
        } else if (dateString.indexOf("month") != -1) {
            var newMonth = resultDate.getMonth() - number[0];
            if (newMonth <= 0) {
                resultDate.setFullYear(resultDate.getFullYear() - 1);
                newMonth += 12;
            }
            resultDate.setMonth(newMonth);
        }
        return resultDate;
    }
}

function sortNewItems() {
    loadDatabase();
    database.newElements.sort(function (a, b) {
        if (a == null) {
            return 1;
        }
        if (b == null) {
            return -1;
        }
        return (database.elements[a].FoundByUserDate > database.elements[b].FoundByUserDate ? -1 : (database.elements[a].FoundByUserDate < database.elements[b].FoundByUserDate ? 1 : 0));
    });
    saveDatabase();
}

function sortOtherElements() {
    loadDatabase();
    database.otherElements.sort(function (a, b) {
        if (a == null) {
            return 1;
        }
        if (b == null) {
            return -1;
        }
        return (database.elements[a].FoundByUserDate > database.elements[b].FoundByUserDate ? -1 : (database.elements[a].FoundByUserDate < database.elements[b].FoundByUserDate ? 1 : 0));
    });
    saveDatabase();
}

function announceNewItems() {
    GM_setValue("GCFriends_overviewContainsUnreadElements", true);
    updateButtonNotificator(true);

    database.newElements = $(database.newElements).map(function (i, e) {
        if (!database.groups.Ignore[database.elements[e].FoundByUser]) {
            return e;
        } else {
            return null;
        }
    }).toArray();

    if (database.newElements.length > 3) {
        if (!opendPopups["_MANY_"]) {
            $.gritter.add({
                title: "Many new logs...",
                text: "There are " + database.newElements.length + " new logs...",
                image: images["icon"],
                sticky: false,
                after_close: function () {
                    if (browserType == "FireFox") {
                        setTimeout(function () {
                            while (database.newElements.length > 0) {
                                database.otherElements.push(database.newElements.pop());
                            }
                            saveDatabase();
                            sortOtherElements();
                        }, 0);
                    } else {
                        while (database.newElements.length > 0) {
                            database.otherElements.push(database.newElements.pop());
                        }
                        saveDatabase();
                        sortOtherElements();
                    }
                }
            });
            opendPopups["_MANY_"] = true;
        }
    } else {
        var element;
        for (i = 0; i < database.newElements.length; i++) {
            element = database.elements[database.newElements[i]];
            if (!opendPopups[element.Id]) {
                $.gritter.add({
                    title: element.FoundByUser + " logged a " + element.Type + ":",
                    text: element.Name + " (" + element.WPId + ") by " + element.Owner + element.FoundByUserDate,
                    image: database[element.FoundByUser].avatarLink,
                    sticky: false,
                    after_close: function () {
                        (function () {
                            if (browserType == "FireFox") {
                                setTimeout(function () {
                                    var temp_element = null;
                                    for (j = 0; j < database.newElements.length; j++) {
                                        if (database.newElements[j] == element.Id) {
                                            temp_element = database.newElements.splice(j, 1)[0];
                                            break;
                                        }
                                    }

                                    if (temp_element != null) {
                                        database.otherElements.push(temp_element);
                                        saveDatabase();
                                        sortOtherElements();
                                    }
                                }, 0);
                            } else {
                                var temp_element = null;
                                for (j = 0; j < database.newElements.length; j++) {
                                    if (database.newElements[j] == element.Id) {
                                        temp_element = database.newElements.splice(j, 1)[0];
                                        break;
                                    }
                                }

                                if (temp_element != null) {
                                    database.otherElements.push(temp_element);
                                    saveDatabase();
                                    sortOtherElements();
                                }
                            }
                        })();
                    }
                });
                opendPopups[element.Id] = true;
            }
        }
    }
}

function updateButtonNotificator(news) {
    if (news) {
        $('#gcFriendsNewItems').show();
    } else {
        $('#gcFriendsNewItems').hide();
    }
}

